        internal units of self-government and/or administration that serve social,
        cultural, and/or economic purposes for the American Indian tribe or tribes
        on the reservations/off-reservation trust lands or OTSAs. The Census Bureau
        obtains the boundary and attribute information for tribal subdivisions on
