        "name": "current-area-hydrography-shapefile", "url": "http://meta.geo.census.gov/data/existing/decennial/GEO/GPMB/TIGERline/TIGER2013/areawater/",
        "type": "harvest", "notes": "The Area Hydrography Shapefile contains the geometry
        and attributes of both perennial and intermittent area hydrography features,
        including ponds, lakes, oceans, swamps (up to the U.S. nautical three-mile
        limit), glaciers, and the area covered by large rivers, streams, and/or canals
        that are represented as double-line drainage. Single-line drainage water features
        can be found in the Linear Hydrography Shapefile (LINEARWATER.shp). Linear
        water features includes single-line drainage water features and artificial
        path features, where they exist, that run through double-line drainage features
        such as rivers, streams, and/or canals, and serve as a linear representation
        of these features.", "owner_org": "31c49abe-512a-412a-9cc7-5b2601325d6b",
