        "type": "harvest", "notes": "The Topological Faces / Area Landmark Relationship
        File (FACESAL.dbf) contains a record for each face / area landmark relationship.
        Face refers to the areal (polygon) topological primitives that make up MTDB.
        A face is bounded by one or more edges; its boundary includes only the edges
        that separate it from other faces, not any interior edges contained within
        the area of the face. The face to which a record in the Topological Faces
        / Area Landmark Relationship File (FACESAL.dbf) applies can be determined
        by linking to the Topological Faces Shapefile (FACES.shp) on the permanent
        topological face identifier (TFID) attribute. The area landmark to which a
        record in the Topological Faces / Area Landmark Relationship File (FACESAL.dbf)
        applies can be determined by linking to the Area Landmark Shapefile (AREALM.shp)
        on the area landmark identifier (AREAID) attribute. A face may be part of
        multiple area landmarks. An area landmark may consist of multiple faces.",
