        "name": "gdelt-dataset", "url": "http://gdeltproject.org/data-gov.metadata.v2.xml",
        "type": "harvest", "notes": "The Global Database of Events, Language, and
        Tone (GDELT Project) monitors the world''s broadcast, print, and web news
        from nearly every corner of every country in over 100 languages and identifies
        the people, locations, organizations, counts, themes, sources, and events
        driving our global society every second of every day, creating a free open
        platform for computing on the entire world.  It was uploaded via the World
        Wide Human Geography Data (WWHGD) working group.", "owner_org": "a376a95d-b898-4c79-adb5-3972a55b5953",
        "private_datasets": false, "organization": {"description": "In 2011, the World-Wide
        Human Geography Data Working Group (WWHGD WG) was created to focus on the
        need for human geography global foundation data in order to provide a basis
        for a deeper understanding of cultures, activities, and attitudes. Well-organized
        and comprehensive human geography data can be applied to analysis that allows
        us to better anticipate the behavior of people over space and time and to
        inform decision-making that supports human security, including crisis mitigation
        and humanitarian response.  The Working Group will focus on understanding
        why people do what they do where they do it.\r\n\r\nThe WWHGD Working Group
        is designed to build voluntary partnerships around human geography data and
        mapping focused on the general principle of making appropriate information
        available at the appropriate scales to promote human security.  This involves
        a voluntary \"whole-of-governments\" national and international approach to
        create a human geography data framework that can leverage ongoing efforts
        around the world to identify, capture, build, share, and disseminate the best
        available structured and unstructured foundation data.", "created": "2014-01-31T10:57:58.659927",
        "title": "World Wide Human Geography Data Working Group", "name": "wwhgd-nga-org",
