        [], "relationships_as_subject": [], "name": "usgs-lidar-point-cloud-las-harvest-source",
        "url": "http://thor-f5.er.usgs.gov/ngtoc/metadata/waf/elevation/lidar_point_cloud/las/",
        "type": "harvest", "notes": "This data collection consists of Lidar Point
        Cloud (LPC) projects as provided to the USGS. These point cloud files contain
        all the original lidar points collected, with the original spatial reference
        and units preserved. These data may have been used as the source of updates
        to the National Elevation Dataset (NED), which serves as the elevation layer
        of the National Map. Lidar (Light detection and ranging) discrete-return point
        cloud data are available in the American Society for Photogrammetry and Remote
        Sensing (ASPRS) LAS format. The LAS format is a standardized binary format
        for storing 3-dimensional point cloud data and point attributes along with
        header information and variable length records specific to the data. Millions
        of data points are stored as a 3-dimensional data cloud as a series of geo-referenced
        x, y coordiniates and z (elevation), as well as other attributes for each
        point. A few older projects in this collection are in ASCII format. Please
        refer to http://www.asprs.org/Committee-General/LASer-LAS-File-Format-Exchange-Activities.html
        for additional information on the .LAS file format.", "owner_org": "bd2cdd5a-4d65-46c0-9937-c8381175f104",
