        27, "recent": 0}, "groups": [], "relationships_as_subject": [], "name": "usgs-national-hydrography-dataset-nhd-downloadable-data-collection-harvest-source",
        "url": "http://thor-f5.er.usgs.gov/ngtoc/metadata/waf/hydrography/nhd/", "notes":
        "The USGS National Hydrography Dataset (NHD) Downloadable Data Collection
        from The National Map (TNM) is a comprehensive set of digital spatial data
        that encodes information about naturally occurring and constructed bodies
        of surface water (lakes, ponds, and reservoirs), paths through which water
        flows (canals, ditches, streams, and rivers), and related entities such as
        point features (springs, wells, stream gages, and dams). The information encoded
        about these features includes classification and other characteristics, delineation,
        geographic name, position and related measures, a \"reach code\" through which
        other information can be related to the NHD, and the direction of water flow.
        The network of reach codes delineating water and transported material flow
        allows users to trace movement in upstream and downstream directions. In addition
        to this geographic information, the dataset contains metadata that supports
        the exchange of future updates and improvements to the data. The NHD supports
        many applications, such as making maps, geocoding observations, flow modeling,
        data maintenance, and stewardship. For additional information on NHD, go to
        http://nhd.usgs.gov/.", "owner_org": "bd2cdd5a-4d65-46c0-9937-c8381175f104",
