        "url": "http://thor-f5.er.usgs.gov/ngtoc/metadata/waf/boundaries/nbd/", "notes":
        "The USGS Governmental Unit Boundaries dataset from The National Map (TNM)
        represents major civil areas for the Nation, including States or Territories,
        counties (or equivalents), Federal and Native American areas, congressional
        districts, minor civil divisions, incorporated places (such as cities and
        towns), and unincorporated places. Boundaries data are useful for understanding
        the extent of jurisdictional or administrative areas for a wide range of applications,
        including mapping or managing resources, and responding to natural disasters.
        Boundaries data also include extents of forest, grassland, park, wilderness,
        wildlife, and other reserve areas useful for recreational activities, such
        as hiking and backpacking. Boundaries data are acquired from a variety of
        government sources. The data represents the source data with minimal editing
        or review by USGS. Please refer to the feature-level metadata for information
        on the data source. The National Map boundaries data is commonly combined
        with other data themes, such as elevation, hydrography, structures, and transportation,
        to produce general reference base maps. The National Map viewer allows free
        downloads of public domain boundaries data in either Esri File Geodatabase
        or Shapefile formats. For additional information on the boundaries data model,
        go to http://nationalmap.gov/boundaries.html.", "owner_org": "bd2cdd5a-4d65-46c0-9937-c8381175f104",
