        "type": "harvest", "notes": "Economic places used to tabulate Economic Census
        data vary from places used to tabulate data from the decennial census, the
        American Community Survey and other demographic surveys.  In addition to incorporated
        places and census designated places (CDPs), economic places include, minor
        civil divisions (MCDs) in the twelve strong MCD states, and balances of MCDs
