        "type": "harvest", "notes": "Primary roads are generally divided, limited-access
        highways within the interstate highway system or under State management, and
        are distinguished by the presence of interchanges.  These highways are accessible
        by ramps and may include some toll highways.  The MAF/TIGER Feature Classification
        Code (MTFCC) is S1100 for primary roads.  Secondary roads are main arteries,
        usually in the U.S. Highway, State Highway, and/or County Highway system.  These
        roads have one or more lanes of traffic in each direction, may or may not
        be divided, and usually have at-grade intersections with many other roads
        and driveways.  They usually have both a local name and a route number.  The
        MAF/TIGER Feature Classification Code (MTFCC) is S1200 for secondary roads.  \r\n",
