        "name": "2014-alaska-native-regional-corporation", "url": "http://meta.geo.census.gov/data/existing/decennial/GEO/GPMB/TIGERline/TIGER2014/anrc/",
        "type": "harvest", "notes": "Alaska Native Regional Corporations (ANRCs) were
        created pursuant to the Alaska Native Claims Settlement Act (ANCSA), which
        is federal legislation (Pub. L. 92-203, 85 Stat. 688 (1971); 43 U.S.C. 1602
        et seq. (2000)) enacted in 1971, as a ''Regional Corporation'' and organized
        under the laws of the State of Alaska as \"Regional Corporations\" to conduct
        both the for profit and non profit affairs of Alaska Natives within defined
        regions of Alaska. Twelve ANRCs cover the entire State of Alaska except for
        the area within the Annette Island Reserve (an American Indian Reservation
        under the governmental authority of the Metlakatla Indian Community). There
        is a thirteenth ANRC that represents the eligible Alaska Natives living outside
        of Alaska that are not members of any of the twelve ANRCs within the State
        of Alaska. Because it has no defined geographic extent, this thirteenth ANRC
        does not appear in the TIGER/Line Shapefiles and the Census Bureau does not
        provide data for it. The Census Bureau offers representatives of the twelve
        ANRCs the opportunity to review and update the ANRC boundaries. ANRCs are
        represented by a 5 character FIPS code unique within Alaska and a nationally
        unique 8 character National Standard (GNIS) code", "owner_org": "31c49abe-512a-412a-9cc7-5b2601325d6b",
