        "name": "2014-area-landmark", "url": "http://meta.geo.census.gov/data/existing/decennial/GEO/GPMB/TIGERline/TIGER2014/arealm/",
        "type": "harvest", "notes": "The Census Bureau includes landmarks in the MTDB
        for locating special features and to help enumerators during field operations.  Some
        of the more common landmark types include area landmarks such as airports,
        cemeteries, parks, schools, and churches and other religious institutions.  The
        Census Bureau added landmark features to MTDB on an as-needed basis and made
        no attempt to ensure that all instances of a particular feature were included.  The
        presence or absence of a landmark such as a hospital or prison does not mean
        that the living quarters associated with that landmark were geocoded to that
        census tabulation block or excluded from the census enumeration.  The Area
        Landmark Shapefile does not include military installations or water bodies
        because they each appear in their own separate shapefiles, MIL.shp and AREAWATER.shp
        respectively.  \r\n", "owner_org": "31c49abe-512a-412a-9cc7-5b2601325d6b",
