        "type": "harvest", "notes": "Combined New England City and Town Areas (CNECTA)
        are defined by the Office of Management and Budget (OMB) and consist of two
        or more adjacent New England City and Town Areas (NECTA) that have significant
        employment interchanges.  The NECTAs that combine to create a CNECTA retain
        separate identities within the larger combined statistical area.  Because
        CNECTAs represent groupings of NECTAs, they should not be ranked or compared
        with individual NECTAs.  \r\n\r\nThe CNECTA boundaries are those defined by
        OMB based on the 2010 Census and published in 2013. \r\n", "owner_org": "31c49abe-512a-412a-9cc7-5b2601325d6b",
