        [], "name": "census-bureau-planned-acquisition", "url": "http://meta.geo.census.gov/data/existing/decennial/GEO/GPMB/TIGERline/RFP/",
        "type": "harvest", "notes": "The Census Bureau updates and maintains address
        data to support the correct allocation of population and housing for censuses
        and surveys.  Boundaries, streets, addresses, structure points, and selected
        other features are maintained in the Master Address File/Topologically Integrated
        Geographic Encoding and Referencing (MAF/TIGER) database.  The Census Bureau
        collects geographic and address data from tribal, state, and local governments
        through a Geographic Support System Initiative (GSS-I) Partnership Program
        and through other geographic programs, such as the annual Boundary and Annexation
        Survey.  When the Census Bureau updates the MAF/TIGER database with new or
        corrected street, address and structure point data, the boundary network must
        be updated concurrently to preserve geographic relationships.  \r\n                                \r\n                Additional
        sources of data are required to ensure complete coverage of all street centerlines
        and addresses for the fifty States, the District of Columbia, Puerto Rico,
        and the Island Areas. Some government partners are unable to provide  street
        and address data that meets the Census\r\n                Bureau''s requirements.
        Therefore, the Census Bureau is requesting proposals for provision of address
        data from commercial vendors that can be easily integrated into the MAF/TIGER
        database.  \r\n            ", "owner_org": "31c49abe-512a-412a-9cc7-5b2601325d6b",
        "private_datasets": false, "organization": {"description": "The Census Bureau''s
