        "type": "harvest", "notes": ".\r\n\r\nAfter each decennial census, the Census
        Bureau delineates urban areas that represent densely developed territory,
        encompassing residential, commercial, and other nonresidential urban land
        uses.  In general, this territory consists of areas of high population density
        and urban land use resulting in a representation of the \"urban footprint.\"  There
        are two types of urban areas: urbanized areas (UAs) that contain 50,000 or
        more people and urban clusters (UCs) that contain at least 2,500 people, but
        fewer than 50,000 people (except in the U.S. Virgin Islands and Guam which
        each contain urban clusters with populations greater than 50,000).  Each urban
        area is identified by a 5-character numeric census code that may contain leading
        zeroes.\r\n\r\nThe primary legal divisions of most states are termed counties.  In
        Louisiana, these divisions are known as parishes.  In Alaska, which has no
        counties, the equivalent entities are the organized boroughs, city and boroughs,
        municipalities, and for the unorganized area, census areas.  The latter are
