        "type": "harvest", "notes": "Congressional Districts are the 435 areas from
        which people are elected to the U.S. House of Representatives.  After the
        apportionment of congressional seats among the states based on census population
        counts, each state is responsible for establishing congressional districts
        for the purpose of electing representatives.  Each congressional district
        is to be as equal in population to all other  congressional districts in a
