        "name": "2016-kml-county-within-ua-500", "url": "http://meta.geo.census.gov/data/existing/decennial/GEO/CPMB/boundary/2016gz/kml_county_within_ua_500/",
        "type": "harvest", "notes": "After each decennial census, the Census Bureau
        delineates urban areas that represent densely developed territory, encompassing
        residential, commercial, and other nonresidential urban land uses.  In general,
        this territory consists of areas of high population  density and urban land
        use resulting in a representation of the \"urban footprint.\"  There are two
        types of urban areas: urbanized areas  (UAs) that contain 50,000 or more people
        and urban clusters (UCs) that contain at least 2,500 people, but fewer than
        50,000 people                  (except in the U.S. Virgin Islands and Guam
        which each contain urban clusters with populations greater than 50,000).  Each
        urban area is identified by a 5-character numeric census code that may contain
        leading zeroes.\r\n                                 <br />\r\nThe primary
        legal divisions of most states are termed counties.  In Louisiana, these divisions
        are known as parishes.  In Alaska, which  has no counties, the equivalent
        entities are the organized boroughs, city and boroughs, municipalities, and
        for the unorganized area,  census areas.  The latter are delineated cooperatively
        for statistical purposes by the State of Alaska and the Census Bureau.  In
        four   states (Maryland, Missouri, Nevada, and Virginia), there are one or
        more incorporated places that are independent of any county              organization
        and thus constitute primary divisions of their states.  These incorporated
        places are known as independent cities and are\r\n                                 treated
        as equivalent entities for purposes of data presentation.  The District of
        Columbia and Guam have no primary divisions, and\r\n                                 each
        area is considered an equivalent entity for purposes of data presentation.  The
        Census Bureau treats the following entities as\r\n                                 equivalents
        of counties for purposes of data presentation: Municipios in Puerto Rico,
        Districts and Islands in American Samoa,\r\n                                 Municipalities
        in the Commonwealth of the Northern Mariana Islands, and Islands in the U.S.
        Virgin Islands.  The entire area of the\r\n                                 United
        States, Puerto Rico, and the Island Areas is covered by counties or equivalent
        entities.\r\n                                 <br />\r\n                                 The
        boundaries for counties and equivalent entities are as of January 1, 2010.",
