        "name": "2016-kml-place-500", "url": "http://meta.geo.census.gov/data/existing/decennial/GEO/CPMB/boundary/2016gz/kml_place_500/",
        "type": "harvest", "notes": "The cartographic boundary files include both
        incorporated places (legal entities) and census designated places or CDPs
        (statistical entities).  An incorporated place is established to provide governmental
        functions for a concentration of people as opposed to a minor civil division
        (MCD), which generally is created to provide services or administer an area
        without regard, necessarily, to population.\r\n Places always nest within
        a state, but may extend across county and county subdivision boundaries.  An
        incorporated place usually is a city, town, village, or borough, but can have
        other legal descriptions.  CDPs are delineated for the decennial census as
        the statistical counterparts of incorporated places.  CDPs are delineated
        to provide data for settled concentrations of population that are identifiable
        by name, but are not legally incorporated under the laws of the state in which
        they are located.  The boundaries for CDPs often are defined in partnership
        with state, local, and/or tribal officials and usually coincide with visible
        features or the boundary of an adjacent incorporated place or another legal
        entity.  CDP boundaries often change from one decennial census to the next
        with changes in the settlement pattern and development; a CDP with the same
        name as in an earlier census does not necessarily have the same boundary.  The
        only population/housing size requirement for CDPs is that they must contain
        some housing and population.\r\n            ", "owner_org": "31c49abe-512a-412a-9cc7-5b2601325d6b",
