        "type": "harvest", "notes": "The Address Ranges Relationship File (ADDR.dbf)
        contains the attributes of each address range.  Each address range applies
        to a single edge and has a unique address range identifier (ARID) value.  The
        edge to which an address range applies can be determined by linking the address
        range to the All Lines Shapefile (EDGES.shp) using the permanent topological
        edge identifier (TLID) attribute.  Multiple address ranges can apply to the
        same edge since an edge can have multiple address ranges.  Note that the most
        inclusive address range associated with each side of a street edge already
        appears in the All Lines Shapefile (EDGES.shp).  The TIGER/Line Files contain
        potential address ranges, not individual addresses.  The term \"address range\"
        refers to the collection of all possible structure numbers from the first
        structure number to the last structure number and all numbers of a specified
        parity in between along an edge side relative to the direction in which the
        edge is coded.  The address ranges in the TIGER/Line Files are potential ranges
        that include the full range of possible structure numbers even though the
        actual structures may not exist.  ", "owner_org": "31c49abe-512a-412a-9cc7-5b2601325d6b",
