        "type": "harvest", "notes": "Metropolitan Divisions subdivide a Metropolitan
        Statistical Area containing a single core urban area that has a population
        of at least 2.5 million to form smaller groupings of counties or equivalent
        entities.  Not all Metropolitan Statistical Areas with urban areas of this
        size will contain Metropolitan Divisions.  Metropolitan Division are defined
        by the Office of Management and Budget (OMB) and consist of one or more main
