        "type": "harvest", "notes": "County subdivisions are the primary divisions
        of counties and their equivalent entities for the reporting of Census Bureau
        data. They include legally-recognized minor civil divisions (MCDs) and statistical
        census county divisions (CCDs), and unorganized territories.  For the 2010
        Census, the MCDs are the primary governmental and/or administrative divisions
        of counties in 29 States and Puerto Rico; Tennessee changed from having CCDs
        for Census 2000 to having MCDs for the 2010 Census.  In MCD States where no
        MCD exists or is not defined, the Census Bureau creates statistical unorganized
        territories to complete coverage.  The entire area of the United States, Puerto
        Rico, and the Island Areas are covered by county subdivisions.  The boundaries
        of most legal MCDs are as of January 1, 2015, as reported through the Census
        Bureau''s Boundary and Annexation Survey (BAS).  \r\n\r\n\r\nThe boundaries
