        including ponds, lakes, oceans, swamps (up to the U.S. nautical three-mile
        limit), glaciers, and the area covered by large rivers, streams, and/or canals
        that are represented as double-line drainage.  Single-line drainage water
        features can be found in the Linear Hydrography Shapefile (LINEARWATER.shp).  Linear
