        "type": "harvest", "notes": "Estates are subdivisions of the three major islands
        in the United States Virgin Islands (USVI). The estates have legally defined
        boundaries and are much smaller in area than the Census Subdistricts (county
        subdivisions), but do not necessarily nest within these districts.  The boundaries
        of the estates are primarily those of the former agricultural plantations
        that existed at the time Denmark transferred the islands to the United States
        in 1917.  The names and boundaries of the estates are in common usage by residents
        and in government administration.  The boundaries of the estates are as of
        January 1, 2010 and were provided to the Census Bureau by the USVI Office
        of the Lieutenant Governor.  Estates can be found in the Sub Minor Civil Division
        (submcd) shapefile for the 2010 and 2011 TIGER/Line products.", "owner_org":
