        "notes": "Total rainfall (measured in millimeters) is calculated for each
        grid cell by adding the daily precipitation records for each given time period.  US
        Air Force 557th Weather Wing (USAF) estimates USAF precipitation data by blending
        four different data sources, the Special Sensor Microwave /Imager satellite
        (SSM/I); Geostationary satellites such as GOES, Global Precipitation Measurement
        core observatory, Meteosat, and GMS. Real Time Nephanalysis Cloud Model (RTNEPH);
        and WMO ground station data. USAF precipitation analysis has been improved
