        "notes": " Metropolitan  and Micropolitan Statistical Areas are together termed
        Core Based Statistical Areas (CBSAs) and are defined by the Office of Management
        and Budget (OMB) and consist of  the county or counties or equivalent entities
        associated with at least one urban core (urbanized area or urban cluster)
