        "url": "https://meta.geo.census.gov/data/existing/decennial/GEO/CPMB/boundary/2016Cartographic/place_500/",
        "notes": "The cartographic boundary files include both incorporated places
        (legal entities) and census designated places or CDPs (statistical entities).
        An incorporated place is established to provide governmental functions for
        a concentration of people as opposed to a minor civil division (MCD), which
        generally is created to provide services or administer an area without regard,
        necessarily, to population. Places always nest within a state, but may extend
        across county and county subdivision boundaries. An incorporated place usually
        is a city, town, village, or borough, but can have other legal descriptions.
        CDPs are delineated for the decennial census as the statistical counterparts
        of incorporated places. CDPs are delineated to provide data for settled concentrations
        of population that are identifiable by name, but are not legally incorporated
        under the laws of the state in which they are located. ", "owner_org": "31c49abe-512a-412a-9cc7-5b2601325d6b",
