        "url": "https://meta.geo.census.gov/data/existing/decennial/GEO/CPMB/boundary/2016Cartographic/place_500kml/",
        "notes": "The cartographic boundary files include both incorporated places
        (legal entities) and census designated places or CDPs (statistical entities).
        An incorporated place is established to provide governmental functions for
        a concentration of people as opposed to a minor civil division (MCD), which
        generally is created to provide services or administer an area without regard,
        necessarily, to population. Places always nest within a state, but may extend
        across county and county subdivision boundaries. An incorporated place usually
        is a city, town, village, or borough, but can have other legal descriptions.
        CDPs are delineated for the decennial census as the statistical counterparts
        of incorporated places. CDPs are delineated to provide data for settled concentrations
        of population that are identifiable by name, but are not legally incorporated
        under the laws of the state in which they are located. The boundaries for
        CDPs often are defined in partnership with state, local, and/or tribal officials
        and usually coincide with visible features or the boundary of an adjacent
        incorporated place or another legal entity. CDP boundaries often change from
        one decennial census to the next with changes in the settlement pattern and
        development; a CDP with the same name as in an earlier census does not necessarily
        have the same boundary. The only population/housing size requirement for CDPs
        is that they must contain some housing and population.\r\n\r\nThe boundaries
        of most incorporated places in this shapefile are as of January 1, 2016, as
        reported through the Census Bureau''s Boundary and Annexation Survey (BAS).
        The boundaries of all CDPs were delineated as part of the Census Bureau''s
        Participant Statistical Areas Program (PSAP) for the 2010 Census.", "owner_org":
