        "name": "2017-aitsn", "url": "https://meta.geo.census.gov/data/existing/decennial/GEO/GPMB/TIGERline/TIGER2017/aitsn/",
        "notes": "\r\n American Indian tribal subdivisions are administrative subdivisions
        of federally recognized American Indian reservations/off-reservation trust
        lands or Oklahoma tribal statistical areas (OTSAs). These entities are internal
        units of self-government and/or administration that serve social, cultural,
        and/or economic purposes for the American Indian tribe or tribes on the reservations/off-reservation
        trust lands or OTSAs. The Census Bureau obtains the boundary and attribute
        information for tribal subdivisions on federally recognized American Indian
        reservations and off-reservation trust lands from federally recognized tribal
        governments through the Census Bureau''s Boundary and Annexation Survey (BAS).
        For the 2010 Census, the boundaries for tribal subdivisions on OTSAs were
        also obtained from federally recognized tribal governments through the Tribal
        Statistical Areas Program (TSAP). Note that tribal subdivisions do not exist
        on all reservations/off-reservation trust lands or OTSAs, rather only where
        they were submitted to the Census Bureau by the federally recognized tribal
        government for that area.\r\n\r\n The boundaries for American Indian tribal
        subdivisions are as of January 1, 2017, as reported by the federally recognized
        tribal governments through the Census Bureau''s Boundary and Annexation Survey
        (BAS). \r\n\r\n The boundaries for tribal subdivisions on OTSAs are those
        reported as of January 1, 2010 through TSAP.", "owner_org": "31c49abe-512a-412a-9cc7-5b2601325d6b",
