        "notes": "The Census Bureau includes landmarks in the MTDB for locating special
        features and to help enumerators during field operations.  Some of the more
        common landmark types include area landmarks such as airports, cemeteries,
        parks, mountain peaks/summits, schools, and churches and other religious institutions.  The
        Census Bureau has added landmark features to MTDB on an as-needed basis and
        made no attempt to ensure that all instances of a particular feature were
        included.  The presence or absence of a landmark such as a hospital or prison
        does not mean that the living quarters associated with that landmark were
