        [], "tags": [], "source_type": "arcgis", "tracking_summary": {"total": 16,
        "recent": 0}, "groups": [], "relationships_as_subject": [], "name": "https-services3-arcgis-com-x6xo7eazaw454atz-arcgis-rest-services-usboundary-featureserver-0",
        "url": "https://services3.arcgis.com/x6xO7EAZaW454AtZ/ArcGIS/rest/services/USBoundary/FeatureServer/0",
        "notes": "This dataset was created to provide resource managers, public officials,
        researchers, and the general public with ready access to the location of the
        international boundary for use to develop binational datasets that depict
        various land use/land cover datasets including resource utilization, environmental
        quality, and human health.This provisional international boundary was developed
        by the International Boundary and Water Commission-United States and Mexico
        (IBWC), to be used as a common boundary for the clipping and geometric integration
        of binational geospatial data sets and represents the international boundary
        as agreed upon by the Governments of the United States and Mexico in accordance
        with the 1970 Boundary Treaty. It provides an electronic, spatially referenced
        representation of the international boundary that may be used for the purposes
        of displaying the boundary and to integrate binational datasets tied into
        the boundary line.This version of the International Boundary Line corresponds
        to the line shown on the 2008 International Boundary Maps that were approved
        in 2009 by Minute 315.", "owner_org": "12d64da3-3041-4748-829b-a378c42f1fee",
        "extras": [], "organization": {"description": "Established in 1889, the International
        Boundary and Water Commission (IBWC) has responsibility for applying the boundary
        and water treaties between the United States and Mexico and settling differences
        that may arise in their application.  The IBWC is an international body composed
        of the United States Section and the Mexican Section, each headed by an Engineer-Commissioner
        appointed by his/her respective president.  Each section is administered independently
        of the other.  The United States Section of the International Boundary and
        Water Commission (USIBWC) is a federal government agency and is headquartered
        in El Paso, Texas.  The IBWC operates under the foreign policy guidance of
        the Department of State.  The Mexican Section is under the administrative
        supervision of the Mexican Ministry of Foreign Affairs and is headquartered
        in Ciudad Juarez, Chihuahua, Mexico.\r\n\r\nThe mission of the IBWC is to
        apply the rights and obligations that the Governments of the United States
        and Mexico assume under boundary and water treaties, and to do so in way that
        benefits the social and economic welfare of people on both sides of the boundary
        and improves relations between the two countries.\r\n\r\nAs provided for in
        treaties and agreements, those rights and obligations include: distribution
        between the two countries of the waters of the Rio Grande and the Colorado
        River; regulation and conservation of the waters of the Rio Grande by joint
        construction, operation and maintenance of international reservoirs; regulation
        of the Colorado River waters allocated to Mexico; protection of lands along
        the river from floods by levee and floodway projects; solution of border sanitation
        and other border water quality problems; preservation of the Rio Grande and
        Colorado River as the international boundary; and demarcation of the land
        boundary.\r\n\r\nIn addition to cooperative projects undertaken to implement
        existing treaties and international agreements, the U.S. and Mexican Commissioners
        also make recommendations to their respective Governments for resolution of
        new or anticipated boundary or water problems.  Early detection and evaluation
        of the problem, and the development of measures for resolution are part of
        the mission of the IBWC.", "created": "2014-12-15T18:11:46.864260", "title":
