        0, "recent": 0}, "groups": [], "relationships_as_subject": [], "name": "2019-addrfeat",
        "url": "https://meta.geo.census.gov/data/existing/decennial/GEO/GPMB/TIGERline/Tiger2019/addrfeat/",
        "notes": "The Address Ranges Feature Shapefile (ADDRFEAT.dbf) contains the
        geospatial edge geometry and attributes of all unsuppressed address ranges
        for a county or county equivalent area. The term \"address range\" refers
        to the collection of all possible structure numbers from the first structure
        number to the last structure number and all numbers of a specified parity
        in between along an edge side relative to the direction in which the edge
        is coded.     Single-address address ranges have been suppressed to maintain
        the confidentiality of the addresses they describe.  Multiple coincident address
        range feature edge records are represented in the shapefile if more than one
        left or right address ranges are associated to the edge. The ADDRFEAT shapefile
        contains a record for each address range to street name combination. Address
        range associated to more than one street name are also represented by multiple
        coincident address range feature edge records.   Note that the ADDRFEAT shapefile
        includes all unsuppressed address ranges compared to the All Lines Shapefile
        (EDGES.shp) which only includes the most inclusive address range associated
        with each side of a street edge.  The TIGER/Line shapefile contain potential
        address ranges, not individual addresses.  The address ranges in the TIGER/Line
        Files are potential ranges that include the full range of possible structure
        numbers even though the actual structures may not exist.", "owner_org": "31c49abe-512a-412a-9cc7-5b2601325d6b",
