        "2019-addrfn", "url": "https://meta.geo.census.gov/data/existing/decennial/GEO/GPMB/TIGERline/Tiger2019/addrfn/",
        "notes": ".\r\n\r\n\r\nThe Address Range / Feature Name Relationship File
        (ADDRFN.dbf) contains a record for each address range / linear feature name
        relationship.  The purpose of this relationship file is to identify all street
        names associated with each address range.  An edge can have several feature
        names; an address range located on an edge can be associated with one or any
        combination of the available feature names (an address range can be linked
        to multiple feature names).  The address range is identified by the address
        range identifier (ARID) attribute that can be used to link to the Address
        Ranges Relationship File (ADDR.dbf).  The linear feature name is identified
        by the linear feature identifier (LINEARID) attribute that can be used to
        link to the Feature Names Relationship File (FEATNAMES.dbf).", "owner_org":
