        "url": "https://meta.geo.census.gov/data/existing/decennial/GEO/GPMB/TIGERline/Tiger2019/bg/",
        "notes": "Block Groups (BGs) are clusters of blocks within the same census
        tract. Each census tract contains at least one BG, and BGs are uniquely numbered
        within census tracts.  BGs have a valid code range of 0 through 9. BGs have
        the same first digit of their 4-digit census block number from the same decennial
        census.  For example, tabulation blocks numbered 5001, 5002, 5005,.., 5999
        within census tract 1210.02 are also within BG 5 within that census tract.  BGs
        coded 0 are intended to only include water area, no land area, and they are
        generally in territorial seas, coastal water, and Great Lakes water areas.
        Block groups generally contain  between 600 and 5,000 people.  A BG usually
        covers a contiguous area but never crosses county or census tract boundaries.
        They may, however, cross the boundaries of other geographic entities like
        county subdivisions, places, urban areas, voting districts, congressional
        districts, and American Indian / Alaska Native / Native Hawaiian areas. \r\n\r\n\r\nThe
        BG boundaries in this release are those that were delineated as part of the
        Census Bureau''s Participant Statistical Areas Program (PSAP) for the 2010
        Census.  \r\n", "owner_org": "31c49abe-512a-412a-9cc7-5b2601325d6b", "extras":
