        "notes": " Congressional Districts are the 435 areas from which people are
        elected to the U.S. House of Representatives. After the apportionment of congressional
        seats among the States based on census population counts, each State is responsible
        for establishing congressional districts for the purpose of electing representatives.
        Each congressional district is to be as equal in population to all other congressional
        districts in a State as practicable. The 116th Congress is seated from January
        2019 to 2021. The TIGER/Line shapefiles for the District of Columbia, Puerto
        Rico, and the Island Areas (American Samoa, Guam, the Commonwealth of the
        Northern Mariana Islands, and the U.S. Virgin Islands) each contain a single
        record for the non-voting delegate district in these areas. The boundaries
        of all other congressional districts reflect information provided to the Census
        Bureau by the states by May 1, 2018", "owner_org": "31c49abe-512a-412a-9cc7-5b2601325d6b",
