        "tracking_summary": {"total": 0, "recent": 0}, "groups": [], "relationships_as_subject":
        [], "name": "2019-concity", "url": "https://meta.geo.census.gov/data/existing/decennial/GEO/GPMB/TIGERline/Tiger2019/concity/",
        "notes": "A consolidated city is a unit of local government for which the
        functions of an incorporated place and its county or minor civil division
        (MCD) have merged. This action results in both the primary incorporated place
        and the county or MCD continuing to exist as legal entities, even though the
        county or MCD performs few or no governmental functions and has few or no
        elected officials. Where this occurs, and where one or more other incorporated
        places in the county or MCD continue to function as separate governments,
        even though they have been included in the consolidated government, the primary
        incorporated place is referred to as a consolidated city. The Census Bureau
        classifies the separately incorporated places within the consolidated city
        as place entities and creates a separate place (balance) record for the portion
        of the consolidated city not within any other place.\r\n\r\nThe boundaries
        of the consolidated cities are those as of January 1, 2019, as reported through
        the Census Bureau''s Boundary and Annexation Survey (BAS).", "owner_org":
        "31c49abe-512a-412a-9cc7-5b2601325d6b", "extras": [], "organization": {"description":
