        within the area of the face.  The Topological Faces Shapefile contains the
        attributes of each topological primitive face.  Each face has a unique topological
        face identifier (TFID) value.  Each face in the shapefile includes the key
        geographic area codes for all geographic areas for which the Census Bureau
        tabulates data for both the 2010 Census and the annual estimates and surveys.  The
        geometries of each of these geographic areas can then be built by dissolving
