        "notes": "After each decennial census, the Census Bureau delineates Public
        Use Microdata Areas (PUMAs) for the tabulation and dissemination of decennial
        census Public Use Microdata Sample (PUMS) data, American Community Survey
        (ACS) PUMS data, and ACS period estimates. Nesting within states, or equivalent
        entities, PUMAs cover the entirety of the United States, Puerto Rico, Guam,
        and the U.S. Virgin Islands. PUMA delineations are subject to population,
        building block geography, geographic nesting, and contiguity criteria. Each
        PUMA is identified by a 5-character numeric census code that may contain leading
        zeros and a descriptive name. \r\n", "owner_org": "31c49abe-512a-412a-9cc7-5b2601325d6b",
