        "notes": "An incorporated place is established to provide governmental functions
        for a concentration of people as opposed to a minor civil division (MCD),
        which generally is created to provide services or administer an area without
        regard, necessarily, to population. Places always nest within a state, but
        may extend across county and county subdivision boundaries. An incorporated
        place usually is a city, town, village, or borough, but can have other legal
        descriptions. CDPs are delineated for the decennial census as the statistical
        counterparts of incorporated places.", "owner_org": "31c49abe-512a-412a-9cc7-5b2601325d6b",
        "extras": [], "organization": {"description": "The Census Bureau''s mission
